    "2013-03-16T00:34:08.924183",nt"name": "geothermal-power-potential-in-utah-1966",nt"isopen":
    false,nt"url": null,nt"notes": "Current interest in the utilization of
    the internal heat if the earth, as represented by steam and hot water, for development
    of electric power and other uses in Utah has prompted this brief survey and synthesis
    of available information. Since earliest times in Utah hot water has been known
    to occur in springs and weeks; many of these have served as the sites of health
    resorts. No attempt has yet been made in Utah to drill for high temperature steam
    that would provide energy for power generation. Areas of high geothermal gradient
    are confined to the western part of the state where mineral fuel sources for local
    energy supply have not been found. ",nt"license_title": null,nt"extras":
